import React, { Component } from 'react';
import './Card.css'
class Card extends Component{
	render(){
		return (
				<div className = 'Card'>
					<img src = 'https://robohash.org/test' alt = 'Movies' />
					<div className = 'Card Title'>
						<h1>Hello</h1> 
					</div>
				</div>	
			)
	}
}

export default Card;
